        React.createElement("path", { d: "M2 5.75c0-.41.34-.75.75-.75h18.5a.75.75 0 010 1.5H2.75A.75.75 0 012 5.75z", fill: primaryFill }),
        React.createElement("path", { d: "M2 18.75c0-.41.34-.75.75-.75h18.5a.75.75 0 010 1.5H2.75a.75.75 0 01-.75-.75z", fill: primaryFill }),
        React.createElement("path", { d: "M2.75 11.5a.75.75 0 000 1.5h18.5a.75.75 0 000-1.5H2.75z", fill: primaryFill }));
};
const TextAlignJustify24Regular = wrapIcon(rawSvg({}), 'TextAlignJustify24Regular');
export default TextAlignJustify24Regular;
